define('extend/validation',[ 'handlebars' ],
  function( Handlebars ){
    return{
      valid: function (view, attr, selector) {
        var $el = view.$('[name=' + attr + ']'), 
            $group = $el.closest('.form-group');    
        $group.removeClass('has-error');
        $group.find('.help-block').html('').addClass('hidden');
      },
      invalid: function (view, attr, error, selector) {
        var $el = view.$('[name=' + attr + ']'),
            $group = $el.closest('.form-group');
        $group.addClass('has-error');
        $group.find('.help-block').html( Handlebars.compile("{{ t error }}")({ 'error': error }) ).removeClass('hidden');
      }
    };
});

define('text!template/modal/signup.html',[],function () { return '<div class="modal-dialog">\n  <div class="modal-content">\n    <div class="modal-header mt-orange">\n      <button type="button" class="close modalClose"><span></span></button>\n      <h4 class="modal-title">{{ t \'Sign Up\' }}</h4>\n    </div>\n    <div class="modal-body">\n        \n  <div class="row">\n    <div class="col-md-12">\n      <form id="signUpForm">\n        <div class="form-group required">\n          <label for="username" class="control-label">{{ t \'Username\' }}</label>\n          <input type="text" class="form-control" id="username" name="username" placeholder="{{ t \'username\' }}">\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <label for="email" class="control-label">{{ t \'Email address\' }}</label>\n          <input type="email" class="form-control" id="email" name="email" placeholder="{{ t \'email address\' }}">\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <label for="password" class="control-label">{{ t \'Password\' }}</label>\n          <input type="password" class="form-control" name="password" id="password">\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <label for="repeatPassword" class="control-label">{{ t \'Repeat Password\' }}</label>\n          <input type="password" class="form-control" name="repeatPassword" id="repeatPassword">\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <label for="language" class="control-label">{{ t \'Language\' }}</label>\n          <select class="form-control" id="language" name="language">\n            <option value="">{{ t \'select\' }}</option>\n            {{#each langSelect}}\n            <option value="{{ this.key }}">{{ this.value }}</option>\n            {{/each}}\n          </select>\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <label for="age" class="control-label">{{ t \'Age\' }}</label>\n          <input type="text" class="form-control" id="age" name="age" />\n          <span class="help-block hidden"></span>\n        </div>\n        <div class="form-group required">\n          <div class="checkbox">\n            <label class="control-label">\n              <input type="checkbox" value="true" id="terms" name="terms" />{{ t \'I agree all your\' }} <a href="#">{{ t \'Terms of Services\' }}</a>\n            </label>\n            <span class="help-block hidden"></span>\n          </div>\n        </div>\n        <div class="form-group">\n          <button type="button" id="signUpButton" class="btn btn-success">{{ t \'Sign Up\' }}</button>\n        </div>\n      </form>\n    </div>\n    <!-- .col -->\n  </div>\n  <!-- .row -->\n  \n    </div>\n  </div>\n</div>';});

define( 'view/modal/signup',[ 'backbone',
          'marionette',
          'handlebars',
          'text!template/modal/signup.html',
          'helper/translate',
          'validation',
          'syphon',
          'extend/validation' ],
function( Backbone, Marionette, Handlebars, tmpl, translate, Validation, Syphon, BootsrtapValidation ) {

  var RegistrationView = Marionette.View.extend({
    tagName   : 'div',
    className : 'modal fade',
    id        : 'modal',
    initialize: function(){
      Backbone.Validation.bind(this);
      this.dialog = Backbone.Radio.channel('dialog');
    },
    template: function() {
      return Handlebars.compile(tmpl)( { langSelect: [{ "key": "de", "value": "Deutsch" }, { "key": "en", "value": "English" }, { "key": "hu", "value": "Magyar" }] } );
    },
    ui: {
      form        : '#signUpForm',
      signUp      : '#signUpButton',
      closeDialog : '.modalClose'
    },
    events: {
      'click @ui.signUp': 'signUp',
      'click @ui.closeDialog': 'closeDialog'
    },
    signUp: function () {
      var formData = Backbone.Syphon.serialize( this.ui.form );
      this.model.set( formData, { validate: true } );
      if(this.model.isValid()){
        // this.model.save();
        alert('Done');
      }
    },
    closeDialog: function() {
      this.dialog.request('close');
    }
  });

  _.extend(Backbone.Validation.callbacks, BootsrtapValidation);

  return RegistrationView;
});
define('model/signup',[ 'backbone' ],
function( Backbone ){
  var RegistrationModel = Backbone.Model.extend({
    validation: {
      username: [{
        required: true,
        msg: 'Please enter an username'
      },{
        minLength: 5,
        msg: 'Not enough length (min 5 character)'
      },{
        maxLength: 25,
        msg: 'Too length (max 25 character)'
      }],
      email: [{
        required: true,
        msg: 'Please enter an email address'
      },{
        pattern: 'email',
        msg: 'Please enter a valid email'
      }],
      password: [{
        required: true,
        msg: 'Please enter a password'
      },{
        minLength: 8,
        msg: 'Not enough length (min 8 character)'
      }],
      repeatPassword: {
        equalTo: 'password',
        msg: 'The passwords does not match'
      },
      language: [{
        required: true,
        msg: 'Please select a language'
      },{
        oneOf: ['de', 'en', 'hu'],
        msg: 'Please select a language'
      }],
      age: [{
        required: true,
        msg: 'Please enter your age'
      },{
        pattern: 'digits',
        msg: 'Please enter a valid number'
      },{
        range: [18, 100],
        msg: 'Please enter a number between 18 and 100'
      }],
      terms: {
        acceptance: true,
        msg: 'Please terms of services'
      }
    }
  });
  return RegistrationModel;
});
define( 'view/modal/signin',[ 'backbone',
          'marionette',
          'handlebars',
          'text!template/modal/signin.html',
          'helper/translate',
          'validation',
          'syphon',
          'extend/validation',
          'view/modal/signup',
          'model/signup'  ],
  function( Backbone, Marionette, Handlebars, tmpl, translate, Validation, Syphon, BootsrtapValidation, ViewModalSignUp, ModelSignUp ) {
    var ModalLogin = Marionette.View.extend({
      tagName   : 'div',
      className : 'modal fade',
      id        : 'modal',
      initialize: function() {
        this.dialog = Backbone.Radio.channel('dialog');
        Backbone.Validation.bind(this);
      },
      template  : Handlebars.compile(tmpl),
      ui: {
        form        : '#signInForm',
        signIn      : '#signIn',
        signUpShow  : '#signUpShow',
        signInClose : '#signInClose',
        closeDialog : '.modalClose'
      },
      events: {
        'click @ui.signIn'     : 'signIn',
        'click @ui.signUpShow' : 'signUpShow',
        'click @ui.signInClose': 'signInClose',
        'click @ui.closeDialog': 'closeDialog'
      },
      signIn: function () {
        var formData = Backbone.Syphon.serialize( this.ui.form );
        this.model.set( formData, { validate: true } );
        if(this.model.isValid()){
          // this.model.save();
          //App.navigate('#main',{ trigger:true, replace: true });
          this.dialog.request('close');
          App.navigate('#dashboard',{ trigger:true });
        }
      },
      signUpShow: function() {
        this.dialog.request('close');
        this.dialog.request('show', new ViewModalSignUp({ model: new ModelSignUp() }));
      },
      signInClose: function() {
        this.dialog.request('close');
      },
      closeDialog: function() {
        this.dialog.request('close');
      }
    });
    
    _.extend(Backbone.Validation.callbacks, BootsrtapValidation);
    
    return ModalLogin;
});
